import React from "react";
import "./CardContent.css";
import projects from "../../projects.json";


function CardContent(props) {
    return (
        <div className="project card ">
            <div className="card-image">
                <figure className="image"></figure>
                <img className="projectimage" src="https://bulma.io/images/placeholders/128x128.png" alt="test" />
            </div>
            <div className="card-content">
                <div className="media">
                    <div className="media-content">
                        <p className="title is-4">{props.name}</p>
                        {
                            projects.map
                        }
                        <p className="subtitle is-6"><a href="">{props.githuburl}</a></p>
                        <p className="subtitle is-6">{props.deployurl}</p>
                        <p className="subtitle is-6">{props.description}</p>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default CardContent
